/*
 * Table accessor.
 */
extern int
idn__sparsemap_getcombiningcharacter(unsigned long v) {
	int idx0, idx1, idx2, idx3;

	if (v > UTF32_MAX)
		return (0);
	idx0 = v >> (COMBININGCHARACTER_BITS_1 + COMBININGCHARACTER_BITS_2);
	idx1 = (v >> COMBININGCHARACTER_BITS_2) & ((1 << COMBININGCHARACTER_BITS_1) - 1);
	idx2 = (v & ((1 << COMBININGCHARACTER_BITS_2) - 1)) >> 3;
	idx3 = 1 << (v & 0x07);
	return combiningcharacter_bitmap[combiningcharacter_imap[combiningcharacter_imap[idx0] + idx1]].bm[idx2] & idx3;
}
